import React, {memo} from 'react';
import styled from 'styled-components';

const WeeklyBestContainer = styled.div`
    text-align: center;
    margin: 0 auto;
    background-color: #ff05;
    width:100%;

    .mainTitle{
        margin-top:96px;
        font-size:42px;
        font-weight: 700;
    }

    .menuWrap{
        margin-top:70px;
        display: flex;
        justify-content: center;

        .link{
            margin-right:40px;

            &:last-child{
                margin-right:0;
            }

            a{
                font-size:20px;
            }
        }
    }

    .itemWrap{
        max-width:1600px;
        margin-top:50px;
        display: flex;

        .itemInner{
            .item{
                width:340px;
                /* background-color: #f645; */

                .imgWrap{
                    position: relative;

                    &::after{
                        content: "1";
                        position: absolute;
                        font-size:22px;
                        display: flex;
                        align-items: center;
                        justify-content: center;
                        color:#fff;
                        top:0;
                        left:0;
                        width:50px;
                        height:50px;
                        background-color: #e86434;
                    }

                    img{
                        max-width:340px;
                    }
                } 
                
                .description{
                    .productName{
                        display: flex;
                        justify-content: space-between;
                        margin-top:10px;

                        .title{
                            display: block;
                            /* background-color: #00f; */
                            height:auto;
                            font-size:18px;
                            width:310px;

                            overflow: hidden;
                            white-space: nowrap;
                            text-overflow: ellipsis;
                            word-break: break-all;
                        }
                    }

                    .price{
                        text-align: left;
                        display: flex;
                        align-items: baseline;
                        

                        .nowPrice{
                            font-size:22px;
                            font-weight: 500;
                            margin-right:8px;
                        }

                        .beforePrice{
                            font-size:16px;
                            color:#aaaaaa;
                            text-decoration: line-through;
                            margin-right:8px;
                        }

                        .discountPercent{
                            font-size:18px;
                            color:#c41e20;
                        }
                    }
                }
            }
        }

        
    }
`;

const WeeklyBest = memo(() => {
  return (
    <WeeklyBestContainer>
      <h1 className='mainTitle'>위클리 베스트</h1>
      <ul className='menuWrap'>
        <li className='link'><a href='#'>우먼</a></li>
        <li className='link'><a href='#'>맨</a></li>
        <li className='link'><a href='#'>키즈</a></li>
        <li className='link'><a href='#'>파자마</a></li>
      </ul>
      <div className='itemWrap'>
        <ul className='itemInner'>
          <li className='item'>
            <div className='imgWrap'>
                <img src='/img/weeklyBest/img1.jpg' />
            </div>
            <div className='description'>
                <div className='productName'>
                    <span><a href='#' className='title'>[리사이클] 베이직 퍼플리스 집업_SPFZD4TU01</a></span>
                    <i><img src='/img/icon/wish.png' /></i>
                </div>
                <div className='price'>
                    <span className='nowPrice'>19,900</span>
                    <span className='beforePrice'>29,900</span>
                    <span className='discountPercent'>33%</span>
                </div>
                <div className='colorBox'>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                    <span className='colorChip'></span>
                </div>
                <div className='review'>
                    <span>리뷰755건</span>
                </div>
            </div>
          </li>
        </ul>
      </div>
    </WeeklyBestContainer>
  );
});

export default WeeklyBest;
